$(function(){var e=$(".calendar-events");if(e.length>0){var a=`timeMin=${encodeURIComponent(moment().format("YYYY-MM-DDTHH:mm:ssZ"))}&timeMax=${encodeURIComponent(moment().add(2,"M").format("YYYY-MM-DDTHH:mm:ssZ"))}`;$.getJSON("https://www.googleapis.com/calendar/v3/calendars/hacksouthza@gmail.com/events?singleEvents=true&orderBy=startTime&key=AIzaSyDBYQkd46PpGDbk2sl0ya-SiyZ_z9a790s&"+a,function(a){$.each(a.items,function(a,t){if(t.start.dateTime)var n=moment(t.start.dateTime).format("D MMM");else n=moment(t.start.date).format("D MMM");var m=$(`<a href="${t.htmlLink}" target="_blank"></a>`).text(t.summary);e.append($(`<li><span class="calendar-event-date">${n}</span> - </li>`).append(m))})})}});